import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Add an item to the cart to enable quantity updates
    await page.waitForSelector('.add-to-cart', { timeout: 5000 });
    await page.locator('.add-to-cart').first().click();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_item_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_item_added.png'));

    // 2. Open the cart modal
    await page.waitForSelector('div.cart', { timeout: 5000 });
    await page.locator('div.cart').click();
    await page.waitForSelector('.cart-item', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_opened.png'));

    // 3. Get the initial quantity
    const initialQuantity = await page.locator('.cart-item-quantity .quantity').textContent();

    // 4. Click the increase quantity button (+)
    // The '+' button is the second .quantity-btn within the .cart-item-quantity div
    await page.locator('.cart-item-quantity .quantity-btn').last().click();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_quantity_updated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_quantity_updated.png'));

    // 5. Get the updated quantity
    const updatedQuantity = await page.locator('.cart-item-quantity .quantity').textContent();

    return {
      success: true,
      action: "Updated cart item quantity",
      extractedData: {
        initialQuantity: parseInt(initialQuantity, 10),
        updatedQuantity: parseInt(updatedQuantity, 10)
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to update cart item quantity",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
